{
  "translationLines": [
    {
      "lineNumber": 213852,
      "originalJapaneseLine": "　バイタル、彼女の指示に従うように」",
      "translatedEnglishLine": "Vital, follow her instructions."
    },
    {
      "lineNumber": 213853,
      "originalJapaneseLine": "「は、はい、分かりました」",
      "translatedEnglishLine": "\"Y-yes, understood.\""
    },
    {
      "lineNumber": 213854,
      "originalJapaneseLine": "「えっ、えっ！　何者よ、あの子！」",
      "translatedEnglishLine": "\"Eh, eh! Who is that girl?!\""
    },
    {
      "lineNumber": 213855,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"..........\""
    },
    {
      "lineNumber": 213856,
      "originalJapaneseLine": "「な……」",
      "translatedEnglishLine": "\"Wha...\""
    },
    {
      "lineNumber": 213857,
      "originalJapaneseLine": "少女はふいっと顔を逸らした。",
      "translatedEnglishLine": "The girl suddenly turned her face away."
    },
    {
      "lineNumber": 213858,
      "originalJapaneseLine": "「……謎の美少女探偵」",
      "translatedEnglishLine": "\"...Mysterious beautiful girl detective.\""
    },
    {
      "lineNumber": 213859,
      "originalJapaneseLine": "「美少女って言った？」",
      "translatedEnglishLine": "\"Did you say 'beautiful girl'?\""
    },
    {
      "lineNumber": 213860,
      "originalJapaneseLine": "「ちが……私が言ったわけじゃ……」",
      "translatedEnglishLine": "\"No... I didn't say that myself...\""
    },
    {
      "lineNumber": 213861,
      "originalJapaneseLine": "「今、美少女って言ったよね？",
      "translatedEnglishLine": "\"You just said 'beautiful girl', didn't you?\""
    },
    {
      "lineNumber": 213862,
      "originalJapaneseLine": "　間違いなく自分で言ったよね？」",
      "translatedEnglishLine": "You definitely said it yourself, right?\""
    },
    {
      "lineNumber": 213863,
      "originalJapaneseLine": "「いや……昨日、そう言われただけで……」",
      "translatedEnglishLine": "\"No... I was just told that yesterday...\""
    },
    {
      "lineNumber": 213864,
      "originalJapaneseLine": "探偵は現場に来た瞬間から、",
      "translatedEnglishLine": "The detective had been mumbling since she arrived at the scene."
    },
    {
      "lineNumber": 213865,
      "originalJapaneseLine": "もにょもにょ喋っていた。",
      "translatedEnglishLine": "She was muttering quietly."
    },
    {
      "lineNumber": 213866,
      "originalJapaneseLine": "「こ、こほん！」",
      "translatedEnglishLine": "\"A-ahem!\""
    },
    {
      "lineNumber": 213867,
      "originalJapaneseLine": "「とにかく、そういう話なので！",
      "translatedEnglishLine": "\"Anyway, that's the story!"
    },
    {
      "lineNumber": 213868,
      "originalJapaneseLine": "　この現場は私が預かります！」",
      "translatedEnglishLine": "I'll take charge of this scene!\""
    },
    {
      "lineNumber": 213869,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 213870,
      "originalJapaneseLine": "「本来、探偵じゃないんですけど……",
      "translatedEnglishLine": "\"I'm not actually a detective, but..."
    },
    {
      "lineNumber": 213871,
      "originalJapaneseLine": "　頑張りますので、宜しくお願いします」",
      "translatedEnglishLine": "I'll do my best, so please look after me.\""
    },
    {
      "lineNumber": 213872,
      "originalJapaneseLine": "「背も腰も低い探偵だね……",
      "translatedEnglishLine": "\"A detective who's short and humble in manner..."
    },
    {
      "lineNumber": 213873,
      "originalJapaneseLine": "　本当に大丈夫？」",
      "translatedEnglishLine": "Are you really going to be okay?\""
    },
    {
      "lineNumber": 213874,
      "originalJapaneseLine": "「ナギ、からかわないの」",
      "translatedEnglishLine": "\"Nagi, don't tease her.\""
    },
    {
      "lineNumber": 213875,
      "originalJapaneseLine": "「にひひひ」",
      "translatedEnglishLine": "\"Nihihihi.\""
    },
    {
      "lineNumber": 213876,
      "originalJapaneseLine": "「えーと、お兄さん」",
      "translatedEnglishLine": "\"Um, mister.\""
    },
    {
      "lineNumber": 213877,
      "originalJapaneseLine": "「えーと、お姉さん」",
      "translatedEnglishLine": "\"Um, miss.\""
    },
    {
      "lineNumber": 213878,
      "originalJapaneseLine": "「えへへ、広場に来ないから",
      "translatedEnglishLine": "\"Hehe, because you didn't come to the plaza,"
    },
    {
      "lineNumber": 213879,
      "originalJapaneseLine": "　様子を見に来ただけなんだけど……",
      "translatedEnglishLine": "I just came to check on things..."
    },
    {
      "lineNumber": 213880,
      "originalJapaneseLine": "　お互いなんだか変なことになっちゃったね」",
      "translatedEnglishLine": "Things somehow turned weird for both of us, huh?\""
    },
    {
      "lineNumber": 213881,
      "originalJapaneseLine": "「それで、聞きたいんだけど……",
      "translatedEnglishLine": "\"So, I want to ask..."
    },
    {
      "lineNumber": 213882,
      "originalJapaneseLine": "　＜エール＞ちゃんはロッキーさんが",
      "translatedEnglishLine": "Do you, <Yell>-chan, think Rocky-san"
    },
    {
      "lineNumber": 213883,
      "originalJapaneseLine": "　犯人だと思う？」",
      "translatedEnglishLine": "is the culprit?\""
    },
    {
      "lineNumber": 213884,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 213885,
      "originalJapaneseLine": "どうやら少女はローブの中で、",
      "translatedEnglishLine": "Apparently, the girl was smiling gently from inside her robe."
    },
    {
      "lineNumber": 213886,
      "originalJapaneseLine": "にっこりと笑っているようだ。",
      "translatedEnglishLine": "She seemed to be smiling warmly."
    },
    {
      "lineNumber": 213887,
      "originalJapaneseLine": "「そっか」",
      "translatedEnglishLine": "\"I see.\""
    },
    {
      "lineNumber": 213888,
      "originalJapaneseLine": "「うん、そうだね。",
      "translatedEnglishLine": "\"Yeah, that's right."
    },
    {
      "lineNumber": 213889,
      "originalJapaneseLine": "　私も信じてる」",
      "translatedEnglishLine": "I believe it too.\""
    },
    {
      "lineNumber": 213890,
      "originalJapaneseLine": "「よーし、頑張って犯人探すから、",
      "translatedEnglishLine": "\"Alright, I'll do my best to find the culprit,"
    },
    {
      "lineNumber": 213891,
      "originalJapaneseLine": "　私に任せといてね！」",
      "translatedEnglishLine": "leave it to me!\""
    },
    {
      "lineNumber": 213892,
      "originalJapaneseLine": "「調査、開始！」",
      "translatedEnglishLine": "\"Investigation, start!\""
    },
    {
      "lineNumber": 213893,
      "originalJapaneseLine": "ローブの少女主導の下、本格的に捜査が始められ、",
      "translatedEnglishLine": "Under the leadership of the robed girl, a serious investigation began,"
    },
    {
      "lineNumber": 213894,
      "originalJapaneseLine": "宿屋内はにわかに物々しくなっていた。",
      "translatedEnglishLine": "and the inn suddenly became tense and serious."
    },
    {
      "lineNumber": 213895,
      "originalJapaneseLine": "「＜エール＞……",
      "translatedEnglishLine": "\"<Yell>..."
    },
    {
      "lineNumber": 213896,
      "originalJapaneseLine": "　ロッキーさんを信じるって……」",
      "translatedEnglishLine": "You believe in Rocky-san...\""
    },
    {
      "lineNumber": 213897,
      "originalJapaneseLine": "「そ、そりゃ俺だってロッキーさんの",
      "translatedEnglishLine": "\"W-well, even I believe in Rocky-san's"
    },
    {
      "lineNumber": 213898,
      "originalJapaneseLine": "　無実は信じてぇけどよぉ……」",
      "translatedEnglishLine": "innocence, but...\""
    },
    {
      "lineNumber": 213899,
      "originalJapaneseLine": "「馬鹿ね……」",
      "translatedEnglishLine": "\"Foolish...\""
    },
    {
      "lineNumber": 213900,
      "originalJapaneseLine": "「ナギの話が本当なら、ロッキーさん",
      "translatedEnglishLine": "\"If Nagi's story is true, Rocky-san"
    },
    {
      "lineNumber": 213901,
      "originalJapaneseLine": "　魔王が現れてからずっと寝ていたんでしょ？」",
      "translatedEnglishLine": "has been sleeping ever since the Demon King appeared, right?\""
    },
    {
      "lineNumber": 213902,
      "originalJapaneseLine": "「あっ！　そっか！」",
      "translatedEnglishLine": "\"Ah! That's right!\""
    },
    {
      "lineNumber": 213903,
      "originalJapaneseLine": "「……ま、そんなこと私達が",
      "translatedEnglishLine": "\"...Well, what we say"
    },
    {
      "lineNumber": 213904,
      "originalJapaneseLine": "　証言しても大した意味はないでしょうけど」",
      "translatedEnglishLine": "wouldn't really mean much anyway.\""
    },
    {
      "lineNumber": 213905,
      "originalJapaneseLine": "「……あら？」",
      "translatedEnglishLine": "\"...Oh?\""
    },
    {
      "lineNumber": 213906,
      "originalJapaneseLine": "「ここは当日もこんなに厳重な鍵が？」",
      "translatedEnglishLine": "\"Was this place locked this securely on that day too?\""
    },
    {
      "lineNumber": 213907,
      "originalJapaneseLine": "「ええ、そうです。",
      "translatedEnglishLine": "\"Yes, that's right."
    },
    {
      "lineNumber": 213908,
      "originalJapaneseLine": "　魔法やピッキングでは開かず、",
      "translatedEnglishLine": "It cannot be opened by magic or picking,"
    },
    {
      "lineNumber": 213909,
      "originalJapaneseLine": "　この鍵でしか……」",
      "translatedEnglishLine": "only with this key...\""
    },
    {
      "lineNumber": 213910,
      "originalJapaneseLine": "「ふむふむ……」",
      "translatedEnglishLine": "\"Hmm, hmm...\""
    },
    {
      "lineNumber": 213911,
      "originalJapaneseLine": "ローブの少女は大人相手にも一切臆することなく、",
      "translatedEnglishLine": "The robed girl showed no hesitation even when facing adults,"
    }
  ]
}

